INSERT INTO `contacts` VALUES (1,'ideofuzion','maxnet.controls@gmail.com','','','','www.ideofuzion.com',0,'2017-06-22 15:55:48','2017-06-22 15:55:48','Greetings,\n\nMy name is Atif Zahid, and I am an Expert in UI/UX designer. I would love to have an opportunity to discuss your project with you.\n\nTo complete your initial project, I would review your existing assets and construct the rest of the Interfaces.\n\nAre you okay with your existing branding? or you want me review it thoroughly to find out everything is pixel accurate and up to the standard? We will be doing design and development in parallel.\n\nI have 7 years of Design Experience and specialized in UI/UX design. Much of my experience comes from working for www.Agnitus.com as a Lead Designer and helped them to grow revenue substantially. \n\nI have recently created UI/UX for a company based in United Kingdom and my designs for their mobile app are shown on their websites http://live.thebitpoint.co.uk/ . \n\nFew other Examples of on-going projects:\nhttps://www.lesfloralies.ae\nhttp://sebago.ideofuzion.com/Sebago/Desktop/  (Replica of American Eagle\'s website)\nhttp://shopafrontend.azurewebsites.net/ (Multi-Vendor E-commerce storeReplica of www.wish.com with extra functionality, iOS and Android Apps under design and development phase)\n\nPortfolio:\nhttps://drive.google.com/file/d/0B8Vjg38ciat_b3YzT2ZSMEFNRW8/view?usp=drive_web\n\nI\'d be happy to provide you with links so that you can review those before making a hiring decision.');
