INSERT INTO `jobs` VALUES (18,'specific','Driver / Rider / Courier',NULL,'Self-employed and free to work to your own availability.\r\nWorking in a small area.\r\nGetting a great rider app (for iOS and Android) so you can manage your own orders.\r\nFree from dealing with cash (apart from tips - which you keep, of course!)\r\nUsing high-quality gear and equipment - like phone holders, protective clothing, helmets & lights.','','A bicycle or scooter/motorbike with relevant safety equipment (road safety is a huge must for us!)\r\nSmartphone - iPhone 4s or above or Android 4.3 or above\r\nThe right to work in the UK','part time',79,NULL,5,3,'deactivated','redirect','https://deliveroo.co.uk/careers','2017-04-04 16:35:38','2017-06-09 09:39:27',1360,NULL,NULL,NULL,NULL,'Ride with us.\r\nDeliver great food to homes and offices everywhere.\r\nFlexible work, competitive fees.',NULL,NULL,'Up to £16 per hour, depending on location.',0),(19,'generic','Test Deliveroo UK Clone from Generic','Deliveroo is a technology company focused on marketing, selling and delivering restaurant meals to the household or office. Our technology platform optimizes food ordering and delivery by integrating web and mobile consumers with restaurant tablet-based point-of-sale order management terminals and our logistics optimization algorithm via our delivery driver smartphone software.','Self-employed and free to work to your own availability. Working in a small area.\r\nGetting a great rider app (for iOS and Android) so you can manage your own orders. Free from dealing with cash (apart from tips - which you keep, of course!)\r\nUsing high-quality gear and equipment - like phone holders, protective clothing, helmets & lights.','Self-employed and free to work to your own availability. Working in a small area.\r\nGetting a great rider app (for iOS and Android) so you can manage your own orders. Free from dealing with cash (apart from tips - which you keep, of course!)\r\nUsing high-quality gear and equipment - like phone holders, protective clothing, helmets & lights.','To work with us, you’ll need the following: A bicycle or scooter/motorbike with relevant safety equipment (road safety is a huge must for us!)\r\nSmartphone - iPhone 4s or above or Android 4.3 or above\r\nThe right to work in the UK','part time',79,NULL,5,3,'deactivated','redirect','https://deliveroo.co.uk/apply','2017-04-04 16:36:15','2017-04-04 16:36:58',70,'','51.5073509','',NULL,'TestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTestTest','true','','up to £16 per hour',0),(22,'specific','eye','BeMyEye is a service that allows to carry out business store checks, mystery shopping and other observations.','','','asd','',77,NULL,12,18,'deactivated','form','','2017-04-05 08:51:40','2017-04-05 08:52:11',1750,'Bordeaux','44.837789','',NULL,'as','','','from 2 euros to 10 euros per \'mission\'. can make up to 100€ per week. ',0),(24,'specific','Driver/Rider',NULL,'','Come driver avrai tutto questo la libertà di scegliere quando lavorare, la nostra App dedicata ad aiutarti in ogni momento e non dovrai maneggiare contanti (mance escluse).','Tutto quello che ti serve è: avere uno scooter o una bicicletta, poter lavorare in Italia, avere uno smartphone (iPhone 4S o successivo, o Android 4.0.3 o successivo).','part time',112,NULL,5,3,'deactivated','redirect','https://deliveroo.it/it/apply','2017-04-06 07:43:02','2017-06-13 09:06:13',685,NULL,NULL,NULL,NULL,'Consegna con noi. Porta i migliori ristoranti nelle case, negli uffici e dappertutto.lavoro flessibile, tariffe competitive.','',NULL,'5€ ora',0),(26,'specific','Delivery Rider',NULL,'Earn as much as £150/day and get paid weekly\r\nYour schedule. You are in control\r\nJoin a tightly-knit community','Flexible hours\r\nBe your own boss\r\nOption to choose your own vehicle','Stuart courier partners can deliver packages by bicycle, moped, car and van.\r\nAttend a short on boarding session, ask us all your questions and pick up your free courier equipment.','part time',79,NULL,5,7,'deactivated','redirect','http://stuart.com/courier/','2017-04-06 16:31:43','2017-05-25 09:26:05',1769,NULL,NULL,NULL,NULL,'Our couriers are responsible for distributing packages and documents for institutions, businesses, government agencies, and individuals. They pick up documents and packages and then deliver them to final destinations within the same area traveling by bicycle, motorcycle, car or a van.\r\nWork nights, weekends, as much as you want. No need to ask for time off.',NULL,NULL,'Competitive; up to £150/day',0),(27,'generic','Delivery Rider Clone','Stuart is a disruptive on-demand delivery app and platform that speeds up the way goods are transported in cities.\r\n\r\nIt connects retail stores with local couriers, enabling anyone to delivery anything at any time. eCommerce platforms can offer customers Stuart’s faster, cheaper delivery option right at checkout, using the Stuart API.\r\n\r\nWe’re powering the future of urban logistics, helping both small stores and big businesses move their goods through cities faster than anyone ever imagined.','We\'re greatWe\'re greatWe\'re greatWe\'re greatWe\'re greatWe\'re great','JobJobJobJobJobJobJob','JobJobJobJobJobJobJobJobJobJobJob','part time',79,NULL,5,7,'deactivated','redirect','http://stuart.com/courier/','2017-04-06 16:36:56','2017-04-06 16:38:09',1760,'','','',NULL,'JOBJOBJOBJOBJOBJOBJOBJOBJOBJOBJOB','true','','Compensation',0),(28,'specific','Van Driver',NULL,'✓ No Vehicle Required\r\n✓ Opportunities to Progress\r\n✓ Empowering Culture with Days Out (Paintballing, Go-karting, Football)','','• Clean drivers licence and eligible to work in UK\r\n• Must pass a CRB criminal background check\r\n• No fault vehicle accidents in last 5 years\r\n• Good spoken and written English\r\n• Polite, professional and friendly\r\n• Good knowledge of London desirable\r\n• Own van not necessary\r\n• Over 25 years old for insurance purposes','full time',79,NULL,1,15,'deactivated','redirect','https://laundrapp.com/driver-jobs','2017-04-10 14:10:24','2017-06-09 08:28:59',1772,NULL,NULL,NULL,NULL,'Laundrapp is one of the UK’s most exciting startups and this is your opportunity to play a vital part in revolutionising an entire industry. We are seeking enthusiastic and dedicated drivers and delivery agents to help deliver fresh laundry & dry cleaning to our customers across London. It’s both a fun and rewarding role with the benefits of working for one of the fastest growing startups here in the UK.',NULL,NULL,'Competitive Pay (starting at £8.50 per hour) + Overtime + Fuel Paid',0),(29,'generic','Tradesman',NULL,'Find more jobs using our platform!','','Experienced and Quality Professional','part time',79,NULL,11,29,'deactivated','redirect','https://www.mybuilder.com/register-as-tradesman','2017-04-10 15:13:34','2017-06-09 09:40:27',1747,NULL,NULL,NULL,NULL,'Architectural Services\r\nBathroom Fitting\r\nBricklaying\r\nCarpentry & Joinery\r\nCarpet Fitting\r\nCentral Heating\r\nChimneys & Fireplaces\r\nConservatories\r\nConversions - General\r\nDamp Proofing\r\nDemolition & Clearing\r\nDriveways\r\nElectrical\r\nExtensions\r\nFascias, Soffits & Guttering\r\nFencing\r\nFlooring\r\nGas Work\r\nGroundwork & Foundations\r\nHandyman\r\nInsulation\r\nKitchen Fitting\r\nLandscape Gardening\r\nLocksmiths\r\nLoft Conversions\r\nNew Builds\r\nPainting & Decorating\r\nPlastering\r\nPlumbing\r\nRestoration & Refurbishment\r\nRoofing\r\nSecurity Systems\r\nStonemasonry\r\nTiling\r\nTree Surgery\r\nWindows',NULL,NULL,'',0),(30,'specific','Become a Runner','Favor is the easiest way to get anything you want in your city delivered to your door in under an hour.','Part Time & Full Time\r\nAt Favor, we work around your schedule and you can even make cash by referring your friends to be runners.','You receive 100% of your tips. All scheduled hours have minimum guaranteed earnings, though most runners average between $10 to $18 per hour.','At this time, you must have an iPhone or Android. You should have reliable transportation and have a clean record. You must be 18 years or older to apply.','',236,NULL,5,3,'deactivated','redirect','https://apply.favordelivery.com/','2017-04-12 08:50:16','2017-04-12 08:50:38',1774,NULL,NULL,NULL,NULL,'Choose your hours. Make serious cash. Explore your city.','',NULL,'You receive 100% of your tips. All scheduled hours have minimum guaranteed earnings, though most runners average between $10 to $18 per hour.',0),(31,'specific','Rider/Driver/Courier',NULL,'Puoi scegliere liberamente i giorni in cui consegnare, tenerti in forma e divertirti lavorando!','','Passione, puntualità, predisposizione ai rapporti con il pubblico, precisione, serietà, cortesia, capacità di lavorare in Team, ottima forma fisica, possedere bici e casco','',112,NULL,5,7,'deactivated','redirect','http://www.ponyzero.com/lavora-con-noi/','2017-04-12 14:01:00','2017-06-13 14:28:44',1775,NULL,NULL,NULL,NULL,'Essere bike messenger, per noi, è uno stile di vita e non un semplice lavoro! Se cerchi un lavoro flessibile e vuoi guadagnare unendo la passione per la bici ad un lavoro, allora compila il form e candidati per pedalare con noi.','',NULL,'',0),(34,'specific','Giardiniere',NULL,'Ogni settimana 1.000 nuovi lavori in tutta Italia.','Flessibilità, accesso a centinaia di clienti nella tua area a un costo minimo per la segnalazione.','Professionalità, serietà, puntualità e rispetto dei preventivi. Il tuo lavoro sarà valutato dai clienti online, e migliori punteggi ricevi più lavori otterrai in futuro. Richiesta esperienza nel giardinaggio.','part time',112,NULL,11,29,'deactivated','redirect','https://www.instapro.it/professionista/registrati','2017-04-12 14:49:41','2017-06-13 12:57:04',1778,NULL,NULL,NULL,NULL,'Prova Instapro e ricevi subito lavori di giardinaggio su misura per la tua ditta. Ogni giorno ricevi nuovi lavo