eat selection, Top-rated restaurants\r\nAll your favorite cuisines\r\n','true',NULL,'',0),(48,'specific','Stamina Driver',NULL,'','Decidi tu quali ordini accettare e trattieni il 100% delle mance.','Una bici e uno smartphone.','',112,NULL,5,3,'deactivated','redirect','http://www.foodinho.it/BecomeADriver.aspx','2017-04-13 13:46:44','2017-06-13 15:09:42',1786,NULL,NULL,NULL,NULL,'Se vivi a Milano e hai una bici e uno smartphone candidati per diventare uno Stamina Driver. Guadagni con la massima flessibilità.','',NULL,'',0),(49,'specific','driver, rider, courier','Amazon Flex is a service for people who want to make money delivering packages for Amazon with their car and smartphone.','We are building the future','all Amazon power behind you','You must be 18, own a bicycle, a motorbike or a scooter','both',236,NULL,5,7,'deactivated','redirect','https://flex.amazon.com/','2017-04-13 13:47:22','2017-04-13 13:47:22',1796,NULL,NULL,NULL,NULL,'be your own boss delivering packages for amazon. set your own schedule, and have more time to pursue your goals and your dreams. ','true',NULL,'15-18$ per hour',0),(50,'specific','driver, rider, courier','Amazon Flex is a service for people who want to make money delivering packages for Amazon with their car and smartphone. Be your own boos, set your own schedule, and have more time to pursue your goals and dreams. Join and see how you can put the power of Amazon behind you.','We are building the future','all Amazon power behind you','You must be 18, own a bicycle, a motorbike or a scooter','both',79,NULL,5,7,'deactivated','redirect','https://flex.amazon.co.uk/','2017-04-13 13:48:41','2017-04-13 13:48:56',1797,NULL,NULL,NULL,NULL,'Amazon Flex is a service for people who want to make money delivering packages for Amazon with their car and smartphone. Be your own boos, set your own schedule, and have more time to pursue your goals and dreams. Join and see how you can put the power of Amazon behind you.','true',NULL,'$18-25\\hour',0),(51,'specific','Alchool delivery rider','Instant Alchool delivery in London','','','','',79,NULL,3,33,'deactivated','redirect','http://www.bevy.co/riders','2017-04-13 14:50:58','2017-04-13 14:50:58',1800,NULL,NULL,NULL,NULL,'by bike or by scooter, join a dynamic team of delivery people','true',NULL,'',0),(52,'specific','Driver\\Autista',NULL,'Con Uber hai la libertà di metterti al volante quando preferisci ed iniziare a guadagnare per te stesso e per la tua famiglia. Sei tu a scegliere quando guidare, dove andare, chi accompagnare.','Con Uber non ci sono orari prestabiliti, hai la libertà e flessibilità di guidare e lavorare quando vuoi. Sei tu a decidere gli orari, senza vincoli né compromessi.','Automobile in buono stato, patente di guida valida, Licenza NCC, più di 21 anni','part time',112,NULL,1,1,'deactivated','redirect','https://www.uber.com/a/join/?var=v3r&exp=70117_t1','2017-04-14 13:32:38','2017-06-13 12:06:07',735,NULL,NULL,NULL,NULL,'Guida con Uber e incrementa i tuoi guadagni come libero professionista. Riceverai pagamenti settimanali aiutando la nostra community di utenti a muoversi per la città. Diventa capo di te stesso e scegli tu liberamente quando guidare e quanto guadagnare senza vincoli né orari.','',NULL,'Fino a 30€ l\'ora',0),(53,'specific','Concierge Agent','Founded by theater insiders, TodayTix is the first and only free mobile app for iOS and Android that provides access to last-minute theater tickets.  We launched in December 2013 in NYC and have quickly grown to a team of 60 full-time employees. Now live in London, Los Angeles, the San Francisco Bay Area, Washington, D.C., Chicago, Boston, Philadelphia, Seattle and Connecticut, the TodayTix team has plans to expand its reach to many new national and global locations, while maintaining our premier concierge service here in NYC. ','','','Previous customer service experience preferred\r\nResponsible, trustworthy\r\nDetail oriented\r\nPositive, cheerful, enthusiastic, warm, outgoing personality\r\nAble to exercise good judgment\r\nExcellent communication and organizational skills\r\nThrives in a fast-paced environment\r\nA positive, “make-it-work” attitude\r\nA team player','part time',236,NULL,10,7,'deactivated','redirect','https://www.todaytix.com/jobs','2017-04-18 11:23:50','2017-04-18 11:23:50',1815,NULL,NULL,NULL,NULL,'We’re looking for outgoing, reliable, organized, positive and detail-oriented theater lovers to join our Concierge Agent team in NYC. Reporting to the Customer Care team, the Concierge Agents are tasked with the delivery of theater tickets to our valued customers 30 minutes before showtime, while also being ambassadors for the TodayTix brand.\r\n\r\nWe are currently hiring those who have a minimum availability of 5 shifts per week. What this entails is a minimum of 3 shifts available between Monday-Friday and 2 shifts available between Saturday - Sunday. These shifts are primarily on Weekday evenings and throughout the day on Weekends. We are especially looking for those with open availability for:  \r\n\r\nWednesday Matinees  \r\nFriday Evenings  \r\nSaturday Matinees and Evenings \r\n\r\nConcierge Agent shifts are an hour long and the pay rate is $15/hour. This position is ideal for full-time students, as well as those with full-time/part-time jobs who need a supplementary income. **For those living outside of Manhattan, please consider your personal commute into the Midtown area for an hour long shift.\r\n\r\nResponsibilities:\r\nDelivery of tickets and brand materials. \r\nEnsuring a smooth and pleasant experience for our customers. ','true',NULL,'$15/hour',0),(54,'specific','Become an \"Eye\"',NULL,'No commitment in terms of hours, just pick the jobs you like, near you and when you have spare time. ','','A smartphone with the bemyeye app installed and valid ID to register.','part time',79,NULL,12,18,'deactivated','redirect','https://www.bemyeye.com/en-eyes','2017-04-19 14:10:30','2017-06-09 09:36:53',823,NULL,NULL,NULL,NULL,'Earn money in your spare time with BeMyEye\r\nBeMyEye pays you cash for completing small jobs in your local area on behalf of big businesses, through our easy-to-use smartphone app.We provide retail audits for large brands who want to know how their products are being displayed in stores across Europe. Your task might be to gather information or take pictures on your phone about promotions, prices or availability of products. Some of our customers would like you to mystery shop for them and report back on your experience. Most jobs will take no more than 10 minutes to complete!',NULL,NULL,'Based on mission, from £1 up to £10 per mission',0),(55,'specific','Diventa un \'Eye\'',NULL,'Il modo piu facile e divertente di guadagnare nei tuoi momenti liberi.','','Avere un po\' di tempo a disposizione, la registrazione e identificazione attraverso l\'app, e scegli le missioni vicino a te, a seconda delle tue preferenza.','part time',112,NULL,12,18,'deactivated','redirect','https://www.bemyeye.com/it-eyes','2017-04-19 14:39:57','2017-06-13 08:49:58',824,NULL,NULL,NULL,NULL,'Forniamo rilevazioni puntuali per conto di grandi aziende che vogliono conoscere come i propri prodotti sono presenti presso i negozi di tutta Europa. La tua missione consisterà nel raccogliere informazioni e immagini circa promozioni, prezzi ed esposizione dei prodotti. Alcuni dei nostri clienti richiedono anche attività di mystery shopping e pareri sulla tua esperienza d’acquisto. La maggior parte dei job richiede non più di 10 minuti del tuo tempo!','',NULL,'€1 - €10 a Missione',0),(56,'specific','Driver/Rider',NULL,'Godrai di orari flessibili e lavorerai con un team giovane in un ambiente dinamico. L\'equipaggiamento tecnico lo forniamo noi.','','Possedere uno smartphone (Android/iOS)\r\nEssere dotato di bicicletta o scooter\r\nEssere alla ricerca di un lavoro flessibile che possa aiutare ad integrare le entrate','part time',112,NULL,5,3,'deactivated','redirect','https://www.foodora.it/ride4us?utm_source=foo