curity partners. Customers receive your 5★ treatment when they want.',NULL,NULL,'',0),(72,'specific','Van Driver',NULL,'Flexible working hours.\r\nAn attractive salary.\r\nThe prospect of having a broad impact on peoples’ lives.\r\nA fun work environment with great people.','','You are an empathic personality with excellent communication skills.\r\nYou are a highly motivated and service-oriented person.\r\nYour way of working is characterized by a high degree of reliability and organizational skills.\r\nYou possess a driver’s license.\r\nYou are a passionate driver and know London´s streets and the best routes.\r\nYou are flexible and able to work in different shifts (esp. in the evenings)\r\nYou possess an own van and are willing to use it for ZipJet on London´s streets ','both',79,NULL,2,15,'deactivated','redirect','https://zipjet.bamboohr.co.uk/jobs/view.php?id=47','2017-04-21 15:56:10','2017-06-09 09:44:11',1823,NULL,NULL,NULL,NULL,'Currently we are looking for Drivers (m/f), who can support our fast growing and highly motivated team in London - VAN DRIVERS ONLY!\r\n\r\nWhat you will be doing:\r\nYou will drive through London´s streets and deliver an excellent service to our customers.\r\nYou will communicate with our customers.\r\nYou will manage your own appointments and orders via our driver app.\r\nYou will represent ZipJet in front of ZipJet´s customers and deliver their clothes in time.\r\n\r\nWe’re a young team of around 50 people in Berlin and London. We have a good dose of experience in all the right places. Our backgrounds are diverse – culturally and professionally. We are having fun doing what we’re doing. People have shown surprise at how much we communicate while we’re working.\r\nWe want to take the hassle out of peoples’ lives by freeing up their time for what they enjoy most, starting with - laundry. For that, we have built an extremely flexible system, allowing people to have their laundry picked up at their convenience and returned to them within 24 hours. We are currently serving our customers in London and Berlin.\r\n\r\nWe are offering our service via mobile apps (iOS & Android) and soon via our website. We strive for operational excellence and are building solutions to serve large numbers of customers in a highly reliable and autonomous manner. We aim to make many more people happy.',NULL,NULL,'',0),(73,'specific','Driver / Rider / Courier',NULL,'','Make great money - Earn competitive pay and keep 100% of your tips.\r\n\r\nWork when you want - The hours are flexible. Create a schedule that works for you.\r\n\r\nMore orders, more opportunities to earn - Grubhub has more orders than any other order platform.\r\n','- 19+ years of age (21+ in Chicago)\r\n- 2+ years driving experience \r\n- Own an iPhone with iOS 8 or higher OR an Android with 4.0 or higher (With data plan)\r\n- Drivers must have a valid driver’s license and auto insurance\r\n- Bikers must have a valid state ID \r\n- Checking account for direct deposit \r\n- Pass a background check','part time',236,NULL,3,3,'deactivated','redirect','https://driver.grubhub.com/?utm_source=seamless.com&utm_medium=owned_channel&utm_campaign=homepagelink','2017-05-05 09:25:15','2017-05-05 09:25:51',1831,NULL,NULL,NULL,NULL,'Become a Grubhub driver and deliver customers the food they love from their favorite restaurants.',NULL,NULL,'',0),(74,'specific','Delivery Driver',NULL,'Deepen your knowledge of locally produced food by engaging with our producer and eater community.\r\nIncredible work environment with passionate, accomplished team members.\r\nLocally-sourced team meals made by our on-site chefs, team visits to our local farmers and foodmakers, and employee discounts on amazing local food!\r\nMost of all -- Good Eggs offers an opportunity to use your energy, creativity and enthusiasm to participate in building a better food system.\r\n','','You’ll use a smartphone and a computer for part of your job. You should be familiar with navigating your way through different computer apps and programs.\r\nYou should be prepared to use standard warehousing tools as well.\r\nDriving\r\n\r\nThe core of this job involves driving, so you’ll need a reliable vehicle that can accommodate over 30 grocery bags.  An SUV or minivan would be great!\r\nPhysical You’ll handle groceries, so you’ll need to be able to lift heavy grocery bags and physically move around a warehouse with ease.\r\n','both',236,NULL,5,39,'deactivated','redirect','http://careers.goodeggs.com/open-positions/?gh_jid=553555','2017-05-05 09:30:45','2017-05-05 09:30:45',1832,NULL,NULL,NULL,NULL,'As a Delivery Driver, you’ll be responsible for ensuring that our local groceries are delivered to customers safely and efficiently. Your role is essential in ensuring customer satisfaction. You’ll work in a small team and you’ll handle a range of tasks each day, outlined below. \r\n\r\nOur warehouse operates from 4:30 AM to midnight daily. We’re looking for new Drivers to work part-time shifts either 9:00 AM - 2:00 PM or 4:00 PM - 9:00 PM with the option to pick up more hours as needed. \r\n\r\nThis position pays $16.00 per hour, $0.54 per mile, and a $10 per month reimbursement for using data on your smartphone. We also offer great health, dental, and vision care benefits for full-time and part-time employees (20 hours per week) and dependents. We also offer free meals while working a 401(k) account. We are proud to offer stock options to all employees! For more information about our business and culture check out the Good Eggs\' blog @ blog.goodeggs.com.  Pursuant to the San Francisco Fair Chance Ordinance, we will consider for employment qualified applicants with arrest and conviction records. \r\n\r\n','true',NULL,'$16 per hour',0),(75,'specific','Become a RushOrder Driver!',NULL,'','','','both',236,NULL,1,1,'deactivated','redirect','https://www.rushorderapp.com/become_drivers','2017-05-05 09:41:27','2017-05-05 09:41:27',1834,NULL,NULL,NULL,NULL,'','true',NULL,'',0),(76,'spe