ation, your own massage table, and a reliable transportation.','part time',79,NULL,4,11,'deactivated','redirect','https://www.soothe.com/apply','2017-06-14 12:22:27','2017-06-20 14:52:10',1955,NULL,NULL,NULL,NULL,'We will help you becoming a better therapist by taking care of the most busy part of the business: getting clients. You will enjoy freedom, convenience and flexibility.',NULL,NULL,'',0),(234,'specific','Tasker',NULL,'','Find the jobs you love, at the rates that you choose, and make a schedule that fits your life.','','both',79,NULL,11,29,'deactivated','redirect','https://www.taskrabbit.com/become-a-tasker','2017-06-14 13:32:00','2017-06-22 14:21:47',1956,NULL,NULL,NULL,NULL,'TaskRabbit will notify you of potential jobs nearby, and you selec the ones you want to complete. Then confirm the details with your client and complete the work. Do not forget to submit your invoice.','true',NULL,'',0),(235,'specific','Delivery and Operations',NULL,'','Work with people who are passionate about community, and interested in expanding culture. Parking and Mileage reimbursements. Lunch 2-3 times a week in the office, company gatherings, meetings, and outings.','You are 18 or older with a friendly, outgoing attitude.\r\nYou have CA insurance, CA registration and a valid CA drivers license.\r\nYou have a minimum of 2 years driving experience in the U.S.\r\nYou have a clean driving record and will pass a driver background check.\r\nYou can lift and carry 40 lbs.\r\nYou own a smartphone, and are comfortable using applications on it.\r\nYou have excellent verbal and written skills.','both',236,NULL,5,3,'deactivated','redirect','https://www.chewse.com/jobs/chewse-pte-drivers/','2017-06-14 16:06:53','2017-06-14 16:09:12',1931,NULL,NULL,NULL,NULL,'Chewse is looking for hospitality superstars who are passionate about food and interested in growing with a part-time Delivery and Operations Team. Our part time team’s main responsibility is ensuring that their deliveries are on time, 